import { Box, Button, Grid } from "@mui/material";
import React from "react";
import logo from "../images/logo.png";

const commonButtonStyles = {
    backgroundColor: "purple", // Custom background color
    color: "white", // Adjust text color for contrast
    "&:hover": {
      backgroundColor: "darkviolet", // Custom hover color
    },
  };

const Header = () => {
  return (
    <Grid container sx={{ background: "pink", padding: 2 }}>
      <Grid item xs={12} md={3}>
        <img src={logo} style={{ height: "30px", width: "30px" }} />
      </Grid>
      <Grid
        item
        xs={12}
        md={9}
        sx={{ display: "flex", justifyContent: "space-between" }}
      >
        <Button varient="contained" sx={{commonButtonStyles}}>Home</Button>
        <Button sx={{commonButtonStyles}}>About us</Button>
        <Button sx={{commonButtonStyles}}>Contact us</Button>
      </Grid>
    </Grid>
  );
};

export default Header;
